import React from 'react';
import { Link } from 'react-router-dom';

function ActionButton({ to, label }) {
  return (
    <Link to={to} className="inline-block bg-blue-500 hover:bg-blue-700 text-white font-bold py-3 px-6 rounded-lg text-lg">
      {label}
    </Link>
  );
}

export default ActionButton;
